INSERT INTO `vm1` (`ChunkID`, `FileName`, `Data`, `Size`) VALUES ('1', 'a3_1.txt', 'TITLE:  ', '8'), ('3', 'a5_3.txt', '            TITLE:  Carotid Atherosclerosis Followup Study            SOURCE: National Heart, Lung, and Blood Institute (NHLBI            BRIEF SUMMARY:        To determine whether the degree of carotid artery atherosclerosis, as measured by Bmode      ultrasound, predicts the development of myocardial infarction, stroke, and allcause      mortality in patients with angiographically defined coronary status. Also, to quantify the      rate of progression of carotid artery disease and to evaluate the risk factors associated      with progression of carotid atherosclerosis.                DETAILED DESCRIPTION:       BACKGROUND:      Although angiographic evidence of coronary atherosclerosis is one of the best predictors of      clinical events, noninvasive imaging of this arterial bed is not yet possible. The      availability of noninvasive methods for imaging the carotid arteries, and the      intraindividual similarity of extent of disease in the coronary and carotid arteries      provides rationale for this study that assesses the usefulness of Bmode ultrascan      evaluation of extracranial carotid artery atherosclerosis as an independent predictor of      clinical sequelae such as fatal and nonfatal myocardial infarction and stroke.      ', '1309');
