s with CAD group, defined by the following criteria: documented prior MI,             PTCA/stent, CABG, or >75% stenosis in any vessel by coronary angiography.          -  Patients without CAD group, defined as: the absence of a prior MI and <50% stenosis             in all vessels by coronary angiography within the past year, or the combination of a             normal exercise perfusion scan and the absence of a prior MI or any interventional             cardiac procedures.        Exclusion criteria          -  MI or cardiac procedures within the past 3 months          -  Diagnoses of cancer, severe congestive heart failure (ejection fraction < 20%),             kidney or liver disease, pancreatitis, other gastrointestinal conditions,          -  Laboratory values of creatinine levels > 1.3, abnormal liver function tests, abnormal             CBC, fasting TG > 400 mg/dl, urine protein > 2+ on urinalysis or > 1000 mg/24 h,             abnormal thyroid function tests, body mass index (BMI) > 34 for men and > 37 for             women or BMI < 20 for both sexes          -  Age < 35 or > 75 years          GENDER -  Both    MINIMUM AGE - 35 Years    MAXIMUM AGE - 75 Years', '5739');
